import "./style.css";
import figureImg from "./../../images/avatar.png";

const SignIn = () => {
    return ( 
        <main className="main">
      <div className="main-content">
        <figure className="figure">
          <img src={figureImg} alt="userphoto" className="figure-img" />
        </figure>

        <form action="/" method="post" className="form">

         <label for="name" className="label-for-name"> <span style="font-weight: bold">Username</span></label>
         <input type="text" id="name" name="user_name" placeholder="type Username" className="input-for-name" />

         <button type="submit" className="btn-sign-in">Sign-In</button>
        </form >
      </div>
    </main>
     );
}

export default SignIn;
